import React from "react";

export default class Slider extends React.Component {
  constructor() {
    super();
    let sliderArr = [1, 2, 3, 4, 5];
  }

  render() {
    return (
      <div className="slider">
        {this.sliderArr.map((item, index) => {
          return (
            <div key={index} className="slide">
              {item}
            </div>
          );
        })}
      </div>
    );
  }
}
